  `alias` varchar(30) DEFAULT NULL COMMENT '别名',
  `big_category_tax_code` varchar(19) DEFAULT NULL COMMENT '大类税收分类编码',
  `small_category_tax_code` varchar(19) DEFAULT NULL COMMENT '小类税收分类编码',
  `update_time` datetime DEFAULT NULL COMMENT '更新时间',
  `category` varchar(40) DEFAULT NULL COMMENT '商品分类',
  `used` int DEFAULT '0' COMMENT '是否占用',
